(12, 0, 0, 0, 0, NULL, 0, '', NULL, 'thanh-toan-tai-diem-giao-hang', '', '- Quý khách thanh toán cho nhân viên giao nhận toàn bộ hoặc phần còn lại của giá trị đơn hàng đã mua (nếu đã đặt cọc)\r\n- Hình thức thanh toán này chỉ thực hiện với các đơn hàng có địa chỉ giao hàng tại nội thành thành phố Hà Nội (trong phạm vi bán kính 30 km tính từ nơi mua hàng).\r\n- Nếu địa điểm giao hàng ngay tại nơi thanh toán, nhân viên giao hàng của chúng tôi sẽ thu tiền khi giao hàng.', 'Thanh toán tại điểm giao hàng', NULL, NULL, 2, 1, 'hinh-thuc-thanh-toan', 1586480229, 0, 0),
(13, 0, 0, 0, 0, NULL, 0, '', NULL, 'thanh-toan-bang-chuyen-khoan', '', '- Nếu địa điểm giao hàng là ngoại thành, ngoại tỉnh hoặc nội thành thành phố Hà Nội nhưng khác với địa điểm thanh toán (trong trường hợp Quý khách gửi quà, gửi hàng cho bạn bè, đối tác …) chúng tôi sẽ thu tiền trước 100% giá trị đơn hàng + phí vận chuyển theo cước phí tính trong chinh sách vận chuyển bằng phương thức chuyển khoản trước khi giao hàng', 'Thanh toán bằng chuyển khoản', NULL, NULL, 3, 1, 'hinh-thuc-thanh-toan', 1586480244, 0, 0),
