(227, 1, 0, 0, 0, 0, '9,8,7,6,2,1', '{\"attr_6\":[\"10\"],\"attr_7\":[\"9\",\"8\"],\"attr_8\":[\"6\"],\"attr_9\":[\"7\"]}', NULL, 50, 0, 0, NULL, '', '&lt;iframe src=&quot;https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3918.6182175946656!2d106.62255967587674!3d10.84050095800689!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31752a2bbb9a30ad%3A0x60a526d6b271688a!2zNTEgRE4xMywgxJDDtG5nIEjGsG5nIFRodeG6rW4sIFF14bqtbiAxMiwgVGjDoG5oIHBo4buRIEjhu5MgQ2jDrSBNaW5oIDcwMDAwMCwgVmnhu4d0IE5hbQ!5e0!3m2!1svi!2s!4v1693730248818!5m2!1svi!2s&quot; width=&quot;600&quot; height=&quot;450&quot; style=&quot;border:0;&quot; allowfullscreen=&quot;&quot; loading=&quot;lazy&quot; referrerpolicy=&quot;no-referrer-when-downgrade&quot;&gt;&lt;/iframe&gt;', '3TLZVT', 'Gương trang điểm 2 mặt để bàn xinh xắn xoay 360 độ nhiều mẫu', 'guong-trang-diem-2-mat-de-ban-xinh-xan-xoay-360-do-nhieu-mau', 'Gương trang điểm 2 mặt để bàn xinh xắn xoay 360 độ nhiều mẫu', '&lt;p&gt;Trang điểm đẹp hơn, nhanh hơn v&amp;agrave; đơn giản hơn. Kh&amp;ocirc;ng phải đứng h&amp;agrave;ng giờ liền trước gương treo tường, chỉ cần ngồi đ&amp;uacute;ng tư thế v&amp;agrave; chỉnh mặt gương cho ph&amp;ugrave; hợp với hướng soi của bạn. T&amp;ecirc;n sản phẩm: Gương trang điểm để b&amp;agrave;n l&amp;uacute;a mạch 2 mặt gương xoay 360 độ Make up, uốn l&amp;ocirc;, đắp mặt nạ đều trở n&amp;ecirc;n dễ d&amp;agrave;ng hơn bao giờ hết. Vật trang tr&amp;iacute; đẹp mắt gi&amp;uacute;p t&amp;ocirc;n l&amp;ecirc;n vẻ chuy&amp;ecirc;n nghiệp v&amp;agrave; sang trọng nơi b&amp;agrave;n trang điểm của bạn. Đ&amp;acirc;y c&amp;ograve;n l&amp;agrave; một m&amp;oacute;n qu&amp;agrave; th&amp;iacute;ch hợp tặng bạn b&amp;egrave;, người th&amp;acirc;n trong những dịp đặc biệt.&lt;/p&gt;\r\n&lt;p&gt;#gương #trang #điểm #gương #hai #mặt #gương #để #b&amp;agrave;n #gươngcute #makeup #make #up&lt;/p&gt;', '{\"p\":\"artboard2-1077.jpg\",\"w\":750,\"h\":750,\"m\":\"image\\/jpeg\"}', '₫35.000 - ₫55.000', 0, 0, 0, 'artboard2-1077.jpg', NULL, 0, 0, 0, 0, 1, 1, 1, 'san-pham', 1693709572, 1693730307, 663),
(230, 2, 0, 0, 0, 0, '8,7,6,5,2,1', '{\"attr_5\":[\"5\"],\"attr_6\":[\"10\"],\"attr_7\":[\"9\"],\"attr_8\":[\"6\"]}', NULL, 1, 0, 0, NULL, '', '', 'ZBFODN', 'Ốp lưng iPhone Shin cậu bé bút chì cạnh viền vuông silicon dẻo bảo vệ camera cho 6s/7/8/X/XR/XS/11/12/13/14 Pro Plus Max', 'op-lung-iphone-shin-cau-be-but-chi-canh-vien-vuong-silicon-deo-bao-ve-camera-cho-6s78xxrxs11121314-pro-plus-max', 'Hàng real chính hãng bảo hành 1 đổi 1 trong 5 tháng', '&lt;p&gt;Ốp lưng iPhone Shin cậu b&amp;eacute; b&amp;uacute;t ch&amp;igrave; cạnh viền vu&amp;ocirc;ng silicon dẻo bảo vệ camera cho 6/6s/7/8/X/XR/XS/11/12/13 Pro Plus Max&lt;/p&gt;\r\n&lt;p&gt;☞ Ốp lưng cạnh viền vu&amp;ocirc;ng sử dụng cho: IPhone 13 / 13 mini / 13 Pro / 13 Pro Max / 12 / 12 Pro / 12 Pro Max / 11 / 11 Pro / 11 Pro Max / XS MAX / XR / Xs / X / 7 Plus / 8 Plus / 7 / 8 / SE 2020 / 6 Plus / 6s Plus / 6 / 6s☜&lt;/p&gt;\r\n&lt;p&gt;☑️ Phong c&amp;aacute;ch: C&amp;aacute; t&amp;iacute;nh, Thời trang, Dễ thương, H&amp;agrave;i hước, cute, Anime ♡ M&amp;agrave;u sắc: Đen, Trắng ♡ Chất liệu: Silicon mềm chất lượng cao ♡ Chức năng: ✔ Chống sốc, Chống va đập, Chống trượt, Chống xước ✔ Chống bụi bẩn, Dễ d&amp;agrave;ng vệ sinh bằng khăn lau ✔ Bảo vệ camera.&lt;/p&gt;\r\n&lt;p&gt;Bảo vệ mặt sau điện thoại, chất liệu mềm dẻo dễ d&amp;agrave;ng th&amp;aacute;o lắp ♡ Đặc điểm ch&amp;iacute;nh: ✔ Mềm mại khi cầm nắm, cảm gi&amp;aacute;c rất th&amp;iacute;ch ✔ Vị tr&amp;iacute; lỗ camera ch&amp;iacute;nh x&amp;aacute;c, bảo vệ hiệu quả k&amp;iacute;nh camera điện thoại ✔ C&amp;oacute; độ đ&amp;agrave;n hồi v&amp;agrave; khả năng hấp thụ sốc ✔ Chống xước ✔ Trọng lượng nhẹ&lt;/p&gt;\r\n&lt;p&gt;♡ Tất cả c&amp;aacute;c model sản phẩm đều đang c&amp;oacute; sẵn h&amp;agrave;ng!!! Nếu muốn, bạn c&amp;oacute; thể li&amp;ecirc;n hệ với dịch vụ chăm s&amp;oacute;c kh&amp;aacute;ch h&amp;agrave;ng trực tuyến để cung cấp cho bạn.&lt;/p&gt;\r\n&lt;p&gt;♡ Dịch vụ của ch&amp;uacute;ng t&amp;ocirc;i: ✔ Vận chuyển nhanh, Trả lời nồng nhiệt kịp thời, Th&amp;aacute;i độ t&amp;iacute;ch cực ✔ Giải quyết nhanh ch&amp;oacute;ng vấn đề cho mọi kh&amp;aacute;ch h&amp;agrave;ng&lt;/p&gt;\r\n&lt;p&gt;♡ Do sự kh&amp;aacute;c biệt của m&amp;agrave;n h&amp;igrave;nh v&amp;agrave; &amp;aacute;nh s&amp;aacute;ng, m&amp;agrave;u sắc c&amp;oacute; thể hơi kh&amp;aacute;c một ch&amp;uacute;t, mong c&amp;aacute;c bạn th&amp;ocirc;ng cảm.&lt;/p&gt;\r\n&lt;p&gt;♡ Nếu c&amp;oacute; vấn đề về chất lượng hoặc vấn đề kh&amp;aacute;c với sản phẩm bạn nhận được, trước hết xin vui l&amp;ograve;ng li&amp;ecirc;n hệ với ch&amp;uacute;ng t&amp;ocirc;i. Ch&amp;uacute;ng t&amp;ocirc;i sẽ giải quyết sớm nhất c&amp;oacute; thể.&lt;/p&gt;\r\n&lt;p&gt;♡ Nếu bạn th&amp;iacute;ch sản phẩm n&amp;agrave;y, xin vui l&amp;ograve;ng cho ch&amp;uacute;ng t&amp;ocirc;i đ&amp;aacute;nh gi&amp;aacute; năm sao, cảm ơn bạn rất nhiều!!!&lt;/p&gt;', '{\"p\":\"sg-11134201-22110-isdf4k37h9jva0-3050.jpg\",\"w\":1024,\"h\":1024,\"m\":\"image\\/jpeg\"}', '0', 0, 0, 0, 'sg-11134201-22110-isdf4k37h9jva0-3050.jpg', NULL, 0, 0, 0, 0, 1, 1, 1, 'san-pham', 1693883808, 1694955466, 228),
