INSERT INTO `table_static` (`id`, `stt`, `photo`, `options`, `tenkhongdauvi`, `noidungvi`, `motavi`, `tenvi`, `taptin`, `type`, `hienthi`, `ngaytao`, `ngaysua`) VALUES
(1, 0, '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', 've-nguyen-nhieu-deverloper', '&lt;p&gt;Ban đầu những đ&amp;ocirc;i gi&amp;agrave;y n&amp;agrave;y được gọi với c&amp;aacute;i t&amp;ecirc;n \'plimsoll\' v&amp;agrave;o thập ni&amp;ecirc;n 1870, xuất hiện trong cuốn s&amp;aacute;ch&amp;nbsp;The Plimsoll Sensation&amp;nbsp;của Nicholette Jones.&lt;a href=&quot;../&quot;&gt;[7]&lt;/a&gt;&lt;/p&gt;\r\n&lt;p&gt;Plimsolls được sử dụng phổ biến bởi những người đi chơi xa v&amp;agrave; sau đ&amp;oacute; cũng bắt đầu được sử dụng bởi c&amp;aacute;c vận động vi&amp;ecirc;n m&amp;ocirc;n&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;tennis&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;croquet&lt;/a&gt;&amp;nbsp;v&amp;igrave; sự thoải m&amp;aacute;i của ch&amp;uacute;ng. Phần đế đặc biệt c&amp;ugrave;ng hoạt tiết được khắc ch&amp;igrave;m b&amp;ecirc;n dưới để gia tăng ma s&amp;aacute;t bề mặt của những đ&amp;ocirc;i gi&amp;agrave;y đựoc ph&amp;aacute;t triển, v&amp;agrave; dần dần ch&amp;uacute;ng cũng được d&amp;ugrave;ng rộng r&amp;atilde;i cho&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;qu&amp;acirc;n đội Anh&lt;/a&gt;. Loại gi&amp;agrave;y cũng dần dần được sử dụng nhiều hơn cho những c&amp;ocirc;ng việc đi lại h&amp;agrave;ng ng&amp;agrave;y v&amp;agrave; trong c&amp;aacute;c hoạt động ngo&amp;agrave;i trời v&amp;agrave;o thế kỷ 20,&amp;nbsp;plimsolls thậm ch&amp;iacute; được ph&amp;aacute;t hiện c&amp;ugrave;ng với x&amp;aacute;c của đo&amp;agrave;n leo n&amp;uacute;i&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;th&amp;aacute;m hiểm Terra Nova&lt;/a&gt;&amp;nbsp;xấu số. Plimsolls thậm ch&amp;iacute; cũng l&amp;agrave; một loại gi&amp;agrave;y bắt buộc trong c&amp;aacute;c tiết học&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;thể dục&lt;/a&gt;&amp;nbsp;của nước Anh.[&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;cần dẫn nguồn&lt;/a&gt;]&lt;/p&gt;\r\n&lt;p&gt;C&amp;ocirc;ng ty gi&amp;agrave;y&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;J.W. Foster and Sons&lt;/a&gt;&amp;nbsp;của anh bắt đầu sản xuất mẫu gi&amp;agrave;y chạy bộ đầu ti&amp;ecirc;n v&amp;agrave;o năm 1895; đ&amp;ocirc;i gi&amp;agrave;y c&amp;oacute; lớp gai ở đế để gi&amp;uacute;p thuận lợi hơn cho việc gia tăng sức bền v&amp;agrave; tốc độ. C&amp;ocirc;ng ty sau đ&amp;oacute; b&amp;aacute;n ra những mẫu gi&amp;agrave;y handmade chất lượng cao tới c&amp;aacute;c vận động vi&amp;ecirc;n điền kinh tr&amp;ecirc;n khắp thế giới, v&amp;agrave; cuối c&amp;ugrave;ng nhận được một hợp đồng sản xuất gi&amp;agrave;y của đội tuyển Anh tham dự&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;thế vận hội m&amp;ugrave;a h&amp;egrave; Olympic 1924&lt;/a&gt;.&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;Harold Abrahams&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a title=&quot;\\&quot; href=&quot;../&quot;&gt;Eric Liddell&lt;/a&gt;&amp;nbsp;đ&amp;atilde; chiến thắng trong phần thi chạy 100m v&amp;agrave; 400m, sử dụng những đ&amp;ocirc;i gi&amp;agrave;y của nh&amp;agrave; Foster.&lt;a href=&quot;../&quot;&gt;[8]&lt;/a&gt;&lt;/p&gt;', '', 'Về Nguyễn Nhiều Deverloper', '18318_taptin.rar', 'gioi-thieu', 1, 1597117692, 1694955830),
(2, 0, '', NULL, '', '&lt;p style=&quot;line-height: 2;&quot;&gt;Over 25 years of&amp;nbsp;&lt;a title=&quot;OHO Services&quot; href=&quot;https://www.oho.com/services&quot; data-entity-substitution=&quot;canonical&quot; data-entity-type=&quot;node&quot; data-entity-uuid=&quot;b9b1c62f-5fa7-4add-83da-2c557f92359b&quot;&gt;industry expertise&lt;/a&gt;&amp;nbsp;in education and healthcare&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;Our work is grounded in&amp;nbsp;&lt;a title=&quot;User Research&quot; href=&quot;https://www.oho.com/services/higher-education/user-research&quot; data-entity-substitution=&quot;canonical&quot; data-entity-type=&quot;node&quot; data-entity-uuid=&quot;fb541c65-f334-4d0d-9439-ad1d7619e6e2&quot;&gt;user research, strategy and customer journey&lt;/a&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;Integrated, in-house&amp;nbsp;&lt;a title=&quot;Services&quot; href=&quot;https://www.oho.com/services&quot; data-entity-substitution=&quot;canonical&quot; data-entity-type=&quot;node&quot; data-entity-uuid=&quot;b9b1c62f-5fa7-4add-83da-2c557f92359b&quot;&gt;design + development teams&lt;/a&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;&lt;a title=&quot;Higher Ed Lead Generation&quot; href=&quot;https://www.oho.com/services/higher-education/digital-marketing-agency&quot; data-entity-substitution=&quot;canonical&quot; data-entity-type=&quot;node&quot; data-entity-uuid=&quot;da9ebabc-bc8f-41a2-9ba3-5d08c69e14a9&quot;&gt;Lead generation campaigns&lt;/a&gt;&amp;nbsp;with digital marketing and SEO&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 2;&quot;&gt;A&amp;nbsp;&lt;a title=&quot;Content Strategy&quot; href=&quot;https://www.oho.com/services/higher-educat